import React, { Component } from 'react';

class TenyesztokComponent extends Component {
    render() {
        return (
            <div>
                <table className="tagokTable">
          <thead>
            <tr>
              <th>Nev</th>

              <th>Cim</th>

              <th>Egyesulet</th>

              <th>Fajtak</th>
            </tr>
          </thead>
          <tbody>
            {this.state.tulajok.map((tulaj) => (
              <tr key={tulaj.id}>
                <td>{tulaj.nev}</td>
                <td>{tulaj.cim}</td>
                <td>{tulaj.egyesuletNev}</td>
                <td>{tulaj.biro}</td>
                <td></td>
                <td>
                  <button className="infoBtn">Olvass tobbet</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
            </div>
        );
    }
}

export default TenyesztokComponent;
